import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import { NavLink } from "react-router-dom";
import { BsArrowRight } from "react-icons/bs";
export const SettingsIndex = () => {
  const SettingsIndexApp = (props) => {
    return (
      <>
        <div className="col-12">
          <div className="Reports_card_main_div">
            <h3>{props.toptile}</h3>
            <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
              {props.arr.cat1.map((val, i) => {
                return (
                  <div key={i} className="celebrations_card_img_top_div">
                    <div className="row ">
                      <div className="col-2">
                        <IconImg
                          className="celebrations_card_img"
                          backgroundImage={val.userImg}
                        />
                        {/* <NavLink to={val.link}></NavLink> */}
                      </div>
                      <div className="col-7">
                        <div className="celebrations_card_user_info">
                          <h5>{val.name}</h5>
                          <p>{val.DOB}</p>
                        </div>
                      </div>
                    </div>
                  </div>
                );
              })}
            </div>
          </div>
        </div>
      </>
    );
  };
  const SettingsIndexData = [
    {
      toptile: "Company Setup",
      link: "/",
      inertitle: "Company Setup",
      text: "Add your company details here",
    },
  ];
  return (
    <>
      <TopPageTitle Name="Settings" />
      <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
        {SettingsIndexData.map((val, i) => {
          return <SettingsIndexApp key={i} toptile={val.toptile} arr={val} />;
        })}
      </div>
    </>
  );
};
